import Text from "../Text";

function Header() {
    return (
    <>
    <Text text='Header'/> 
    <div>
        
     
        <h1>Header</h1>
        <h2>Sub Header</h2>
        
       <div>
           <h3>Card</h3>
           <p>Text</p>
       </div>
    </div> 
    </>
    );
     
  
  }
  
  export default Header;
